# Prefix: Languagesystems
# automatic
languagesystem DFLT dflt;

languagesystem thai dflt;

languagesystem latn dflt;
languagesystem latn AZE;
languagesystem latn CRT;
languagesystem latn KAZ;
languagesystem latn TAT;
languagesystem latn TRK;
languagesystem latn ROM;
languagesystem latn MOL;
languagesystem latn CAT;
languagesystem latn NLD;


feature aalt {
# automatic
feature locl;
feature sups;
feature frac;
feature ordn;
feature case;

} aalt;

feature ccmp {
lookup thai_decomb {
 sub saraAm-thai by nikhahit-thai saraAa-thai;
} thai_decomb;

lookup thai_comb {
sub maiEk-thai nikhahit-thai by nikhahit_maiEk-thai;
sub maiTho-thai nikhahit-thai by nikhahit_maiTho-thai;
sub maiTri-thai nikhahit-thai by nikhahit_maiTri-thai;
sub maiChattawa-thai nikhahit-thai by nikhahit_maiChattawa-thai;
sub maiEk-thai.narrow nikhahit-thai.narrow by nikhahit_maiEk-thai.narrow;
sub maiTho-thai.narrow nikhahit-thai.narrow by nikhahit_maiTho-thai.narrow;
sub maiTri-thai.narrow nikhahit-thai.narrow by nikhahit_maiTri-thai.narrow;
sub maiChattawa-thai.narrow nikhahit-thai.narrow by nikhahit_maiChattawa-thai.narrow;
sub nikhahit-thai maiEk-thai by nikhahit_maiEk-thai;
sub nikhahit-thai maiTho-thai by nikhahit_maiTho-thai;
sub nikhahit-thai maiTri-thai by nikhahit_maiTri-thai;
sub nikhahit-thai maiChattawa-thai by nikhahit_maiChattawa-thai;
sub nikhahit-thai.narrow maiEk-thai.narrow by nikhahit_maiEk-thai.narrow;
sub nikhahit-thai.narrow maiTho-thai.narrow by nikhahit_maiTho-thai.narrow;
sub nikhahit-thai.narrow maiTri-thai.narrow by nikhahit_maiTri-thai.narrow;
sub nikhahit-thai.narrow maiChattawa-thai.narrow by nikhahit_maiChattawa-thai.narrow;
} thai_comb;

lookup thai_comb1{
	sub [@thai_marks @thai_narrowmarks] @thai_vowels' by @thai_smallvowels;
	sub @thai_narrowmarks @thai_marks' by @thai_narrowmarks;
	sub loChula-thai' [@thai_marks @thai_vowels] by loChula-thai.short;
	sub loChula-thai' @thai_bottommarks @thai_vowels by loChula-thai.short;
	sub [poPla-thai foFa-thai foFan-thai]' @thai_marks by [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01];
	sub [poPla-thai foFa-thai foFan-thai]' @thai_vowels by [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01];
	sub [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01] @thai_marks' by @thai_narrowmarks;
	sub [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01] @thai_vowels' by @thai_narrowvowels;
	sub [poPla-thai foFa-thai foFan-thai]' @thai_bottommarks @thai_vowels by [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01];
	sub [poPla-thai.alt01 foFa-thai.alt01 foFan-thai.alt01] @thai_bottommarks @thai_vowels' by @thai_narrowvowels;
	sub [thoThan-thai soSala-thai soSua-thai hoNokhuk-thai]' @thai_marks by [thoThan-thai.alt01 soSala-thai.alt01 soSua-thai.alt01 hoNokhuk-thai.alt01];
	sub [thoThan-thai soSala-thai soSua-thai hoNokhuk-thai]' @thai_vowels by [thoThan-thai.alt01 soSala-thai.alt01 soSua-thai.alt01 hoNokhuk-thai.alt01];
	sub [soSua-thai soSala-thai hoNokhuk-thai thoThan-thai]' @thai_bottommarks [maiEk-thai maiTho-thai maiTri-thai maiChattawa-thai thanthakhat-thai] by [soSua-thai.alt01 soSala-thai.alt01 hoNokhuk-thai.alt01 thoThan-thai.less.alt01];
	sub [yoYing-thai thoThan-thai doChada-thai toPatak-thai]' @thai_bottommarks by [yoYing-thai.less thoThan-thai.less doChada-thai.short toPatak-thai.short];
	sub [doChada-thai.short toPatak-thai.short] @thai_bottommarks' by @thai_smallbottommarks;
} thai_comb1;

script thai;
lookup thai_decomb;
lookup thai_comb;
lookup thai_comb1;

} ccmp;

feature locl {
# automatic
script latn;
language AZE;
lookup locl_latn_0 {
	sub i by idotaccent;
} locl_latn_0;
language CRT;
lookup locl_latn_0;
language KAZ;
lookup locl_latn_0;
language TAT;
lookup locl_latn_0;
language TRK;
lookup locl_latn_0;

script latn;
language ROM;
lookup locl_latn_1 {
	sub Scedilla by Scommaaccent;
	sub scedilla by scommaaccent;
	sub Tcedilla by Tcommaaccent;
	sub tcedilla by tcommaaccent;
} locl_latn_1;
language MOL;
lookup locl_latn_1;

script latn;
language CAT;
lookup locl_latn_2 {
	sub  l' periodcentered' l by ldot;
	sub  L' periodcentered' L by Ldot;
} locl_latn_2;

script latn;
language NLD;
lookup locl_latn_3 {
	sub iacute j' by jacute;
	sub Iacute J' by Jacute;
} locl_latn_3;

} locl;

feature sups {
# automatic
sub one by onesuperior;
sub two by twosuperior;
sub three by threesuperior;
sub four by foursuperior;

} sups;

feature frac {
# automatic
sub one slash four by onequarter;
sub one slash two by onehalf;
sub three slash four by threequarters;

} frac;

feature ordn {
# automatic
sub [zero one two three four five six seven eight nine] [A a]' by ordfeminine;
sub [zero one two three four five six seven eight nine] [O o]' by ordmasculine;
sub N o period by numero;

} ordn;

feature case {
# automatic
sub dieresiscomb by dieresiscomb.case;
sub dotaccentcomb by dotaccentcomb.case;
sub gravecomb by gravecomb.case;
sub acutecomb by acutecomb.case;
sub hungarumlautcomb by hungarumlautcomb.case;
sub circumflexcomb by circumflexcomb.case;
sub caroncomb by caroncomb.case;
sub brevecomb by brevecomb.case;
sub ringcomb by ringcomb.case;
sub tildecomb by tildecomb.case;
sub macroncomb by macroncomb.case;

} case;

feature rlig {
# automatic
lookup rlig_thai_0 {
	lookupflag IgnoreMarks;
	sub lu-thai lakkhangyao-thai by lu_lakkhangyao-thai;
	sub ru-thai lakkhangyao-thai by ru_lakkhangyao-thai;
} rlig_thai_0;

script thai;
lookup rlig_thai_0;

} rlig;

